#include "gtest/gtest.h"
#include <cstring>
#include "parse.c"


TEST(test_parse_complete_operand_set_FIRST, string_equal)
{
        char setcommand[] = "set \"testbigvalueisset\" \"nowisvalue\"";

        struct parse_res res;
        alloc_parse(&res);
        parse(setcommand, strlen(setcommand), &res);

        // sdd(res.op_code);
        
        EXPECT_STREQ(res.op1, "testbigvalueisset");
        free_parse(&res);
}

TEST(test_parse_complete_operand_set_FIRST_ONLY, string_equal)
{
        char setcommand[] = "get \"testbigvalueisset\"";

        struct parse_res res;
        alloc_parse(&res);
        parse(setcommand, strlen(setcommand), &res);
        EXPECT_STREQ(res.op2, "");
        free_parse(&res);
}

TEST(test_parse_overflow, len_equal)
{
        char setcommand[] = "set \"\" \"\"";

        struct parse_res res;
        alloc_parse(&res);
        parse(setcommand, strlen(setcommand), &res);
        // sdd(res.op2 + 2048);
        // EXPECT_STREQ(, "a");
        EXPECT_EQ(strlen(res.op1), 49152);
        free_parse(&res);
}

int main() 
{
        testing::InitGoogleTest();
        return RUN_ALL_TESTS();
}